import React from 'react';

class MyForm extends React.Component {
 render(){
    return (
        <div>
            <input type="text"/><br/>
            <input type="text"/><br/>
            <select>
            <option>one</option>
            <option>two</option>
            <option>three</option>
            </select>
        </div>
    );
 }
}
export default MyForm;
